    ?birthplace <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Settlement> . 
    ?birthplace <http://dbpedia.org/property/country> <http://dbpedia.org/resource/United_States> . 
    ?entity <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> ?birthplace . 
    BIND(?entity AS ?result) }
  UNION
  { ?awardee <http://dbpedia.org/ontology/award> <http://dbpedia.org/resource/Gillmore_Medal> . 
    ?awardee <http://dbpedia.org/property/militaryUnit> ?force . 
    BIND(?force AS ?result) }
  UNION
  { <http://dbpedia.org/resource/Amasa_Tracy> <http://dbpedia.org/property/war> ?war . 
    BIND(?war AS ?result) }
}

SELECT ?result WHERE { 
