SELECT ?result WHERE { 
  { ?writer <http://dbpedia.org/ontology/notableWork> <http://dbpedia.org/resource/No_Alternative> . 
    ?bandMember <http://dbpedia.org/ontology/bandMember> ?writer . 
    ?bandMember <http://www.w3.org/ns/org#member> ?result . }
  UNION
  { <http://dbpedia.org/resource/R.E.M.> <http://dbpedia.org/ontology/associatedBand> ?artist . 
    ?artist <http://dbpedia.org/ontology/associatedAct> ?associatedArtist . 
    ?associatedArtist <http://www.w3.org/ns/org#member> ?result . }
  FILTER (?result != <http://dbpedia.org/resource/R.E.M.>) .
}

However, a more simplified query considering the direct relationships would be:

SELECT ?result WHERE { 
  { ?writer <http://dbpedia.org/ontology/notableWork> <http://dbpedia.org/resource/No_Alternative> . 
    ?bandMember <http://www.w3.org/ns/org#member> ?writer . 
    ?bandMember <http://www.w3.org/ns/org#member> ?result . }
  UNION
  { <http://dbpedia.org/resource/R.E.M.> <http://dbpedia.org/ontology/associatedAct> ?artist . 
    ?artist <http://dbpedia.org/ontology/associatedAct> ?result . }
}

SELECT ?result WHERE { 
  { <http://dbpedia.org/resource/Ab_Kya_Hoga> <http://dbpedia.org/ontology/starring> ?actor . 
